-- Re-enable triggers
SET session_replication_role = DEFAULT;

-- Update sequences to max id + 1
DO $$
DECLARE
    seq_name TEXT;
    table_name TEXT;
    max_id BIGINT;
BEGIN
    FOR seq_name, table_name IN
        SELECT s.relname, regexp_replace(s.relname, '_seq$', '')
        FROM pg_class s
        JOIN pg_namespace n ON s.relnamespace = n.oid
        WHERE s.relkind = 'S'
        AND n.nspname = 'public'
        AND s.relname ~ '^(pay_app|pay_demo_withdraw|pay_notify_log|pay_notify_task|pay_order|pay_order_extension|pay_refund|pay_transfer|pay_wallet|pay_wallet_recharge|pay_wallet_recharge_package|pay_wallet_transaction)_seq$'
    LOOP
        BEGIN
            EXECUTE format('SELECT COALESCE(MAX(id), 0) + 1 FROM %I', table_name) INTO max_id;
            IF max_id IS NOT NULL THEN
                EXECUTE format('ALTER SEQUENCE %I RESTART WITH %s', seq_name, max_id);
                RAISE NOTICE 'Updated sequence % to %', seq_name, max_id;
            END IF;
        EXCEPTION WHEN OTHERS THEN
            -- Table might not exist, skip
            NULL;
        END;
    END LOOP;
END $$;

